import React, { useState } from 'react';

export default function TournamentForm() {
  const [formData, setFormData] = useState({
    leaderEmail: '',
    tournamentName: '',
    teamsCount: 0,
    bidPointsPerTeam: 0,
    teams: [],
    players: [], // Array to store player profiles
  });

  // Handle general form input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    const newValue = name === 'teamsCount' || name === 'bidPointsPerTeam' ? parseInt(value) : value;

    setFormData((prevData) => {
      if (name === 'teamsCount') {
        const updatedTeams = Array.from(
          { length: newValue || 0 },
          (_, index) => ({
            name: prevData.teams[index]?.name || '',
            bidPoints: prevData.bidPointsPerTeam || 0,
          })
        );
        return {
          ...prevData,
          teamsCount: newValue,
          teams: updatedTeams,
        };
      }

      if (name === 'bidPointsPerTeam') {
        const updatedTeams = prevData.teams.map((team) => ({
          ...team,
          bidPoints: newValue || 0,
        }));
        return {
          ...prevData,
          bidPointsPerTeam: newValue,
          teams: updatedTeams,
        };
      }

      return {
        ...prevData,
        [name]: newValue,
      };
    });
  };

  // Handle player name change
  const handlePlayerNameChange = (index, value) => {
    const updatedPlayers = [...formData.players];
    updatedPlayers[index] = {
      ...updatedPlayers[index],
      name: value,
    };
    setFormData({
      ...formData,
      players: updatedPlayers,
    });
  };

  // Handle player picture upload
  const handlePlayerPictureChange = (index, file) => {
    const updatedPlayers = [...formData.players];
    updatedPlayers[index] = {
      ...updatedPlayers[index],
      picture: file,
    };
    setFormData({
      ...formData,
      players: updatedPlayers,
    });
  };

  // Add a new player
  const addPlayer = () => {
    setFormData({
      ...formData,
      players: [...formData.players, { name: '', picture: null }],
    });
  };

  // Remove a player
  const removePlayer = (index) => {
    const updatedPlayers = formData.players.filter((_, i) => i !== index);
    setFormData({
      ...formData,
      players: updatedPlayers,
    });
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
  };

  return (
    <div>
      <h1>Tournament Form</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="email"
          name="leaderEmail"
          value={formData.leaderEmail}
          onChange={handleChange}
          placeholder="Leader Email"
          required
        />
        <input
          type="text"
          name="tournamentName"
          value={formData.tournamentName}
          onChange={handleChange}
          placeholder="Tournament Name"
          required
        />
        <input
          type="number"
          name="teamsCount"
          value={formData.teamsCount}
          onChange={handleChange}
          placeholder="Number of Teams"
          required
        />
        <input
          type="number"
          name="bidPointsPerTeam"
          value={formData.bidPointsPerTeam}
          onChange={handleChange}
          placeholder="Bid Points Per Team"
          required
        />

        {/* Render Team Names dynamically */}
        <div>
          <h3>Team Names</h3>
          {formData.teams.map((team, index) => (
            <div key={index}>
              <input
                type="text"
                value={team.name}
                onChange={(e) => handleTeamChange(index, e.target.value)}
                placeholder={`Team ${index + 1} Name`}
                required
              />
              <span> - Bid Points: {team.bidPoints}</span>
            </div>
          ))}
        </div>

        {/* Player Profiles */}
        <div>
          <h3>Player Profiles</h3>
          {formData.players.map((player, index) => (
            <div key={index}>
              <input
                type="text"
                value={player.name}
                onChange={(e) => handlePlayerNameChange(index, e.target.value)}
                placeholder={`Player ${index + 1} Name`}
                required
              />
              <input
                type="file"
                onChange={(e) => handlePlayerPictureChange(index, e.target.files[0])}
                accept="image/*"
                required
              />
              {player.picture && (
                <span> - Uploaded: {player.picture.name}</span>
              )}
              <button type="button" onClick={() => removePlayer(index)}>Remove Player</button>
            </div>
          ))}
          <button type="button" onClick={addPlayer}>Add Another Player</button>
        </div>

        <button type="submit">Submit Tournament</button>
      </form>
    </div>
  );
}
